import Social from './social';
import LatestPost from './latestPosts'

function Footer() {
  return (
    <>
      <footer className="bg-black tColor">
        <div class="row">
            <div class="col-lg-4">
              quick links
            </div>
            <div class="col-lg-4">
               <Social/> 
            </div>
            <div class="col-lg-4 pt-4"></div>
          </div>
      </footer>
    </>
  );
}

export default Footer;
